import React, { useState } from 'react';
import Timer from './Timer';
import Youtube from './Youtube/Youtube.js';
import Quote from './Quotes.js';
import './App.css';
import Cloud from './cloud.png';
import TV from './tv.jpg';

function App() {
  return (
    <div className="App">
      <img src={Cloud} className="cloud"/> 
      <img src={TV} className="tv"/>
      <Timer/>
      <Youtube/>
      <Quote/>
      <text className="playlist">this is a playlist</text>

    </div>
  )
}

export default App;
